import React from "react";
import style from "./NavBar.module.css";

function NavBar() {
  return (
    <nav className={style.nav}>
      <ul>
        <li className={style.l1}><a>My Server</a> </li>
        <li className={style.l2}><a>Recommended</a> </li>
        <li className={style.l3}><a></a> </li>
      </ul>
    </nav>
  );
}

export default NavBar;
